<script>
const AREA_NODES = {"tmba": ["gt-tmba-thsec", "gt-tmba-rrsec", "gt-tmba-ofsec-scagg", "gt-tmba-bkmsec", "gt-tmba-chmsec", "gt-tmba-wmdsec", "gt-tmba-mqsec", "gt-tmba-shubasec"], "lnsa": ["gt-lnsa-lesc1", "gt-lnsa-lesc2", "gt-lnsa-lesc3", "gt-lnsa-lesc4"], "phla": ["mp-phla-hlpsec"], "wtbk": ["mp-wtbk-dmmsec", "mp-wtbk-pndsec-rtr", "mp-wtbk-crnsec-rtr", "mp-wtbk-ndpsec-rtr", "mp-wtbk-sybsec-rtr", "mp-wtbk-cwrsec"]};

function getGraph() {
    return document.getElementById("map");
}

function populateNodes(area) {
    const sel = document.getElementById("node-select");
    sel.innerHTML = "";
    if (!area || !AREA_NODES[area]) return;
    AREA_NODES[area].forEach(n => {
        const opt = document.createElement("option");
        opt.value = n;
        opt.textContent = n;
        sel.appendChild(opt);
    });
}

document.getElementById("area-select").onchange = e => {
    populateNodes(e.target.value);
};

document.getElementById("select-all-btn").onclick = () => {
    const sel = document.getElementById("node-select");
    for (let i = 0; i < sel.options.length; i++) {
        sel.options[i].selected = true;
    }
};

function estimateZoom(span) {
    if (span >20) return 4;
    if (span >10) return 5;
    if (span >5)  return 6;
    if (span >2)  return 8;
    if (span >1)  return 9;
    if (span >0.5) return 10;
    if (span >0.25) return 11;
    if (span >0.1)  return 12;
    if (span >0.05) return 13;
    if (span >0.02) return 14;
    return 15;
}

function applyFilters() {
    const gd = getGraph();
    const normalize = (v) => String(v ?? "").toLowerCase().trim();

    const ikejaQuery = normalize(document.getElementById("search-ikeja").value);
    const area = normalize(document.getElementById("area-select").value);
    const nodeSel = document.getElementById("node-select");
    const nodes = Array.from(nodeSel.selectedOptions).map(o => normalize(o.value));

    let shownLats = [], shownLons = [];
    let count = 0;

    gd.data.forEach((trace, idx) => {
        if (idx === 0) return; // dummy colorbar trace

        const isVisible = gd._fullData && gd._fullData[idx]
            ? gd._fullData[idx].visible !== false
            : trace.visible !== false;
        if (!isVisible) return; // skip hidden modes to avoid needless work

        const custom = trace.customdata || [];
        const newOpacity = [];

        for (let i = 0; i < custom.length; i++) {
            const ikeja = normalize(custom[i][0]);
            const node  = normalize(custom[i][4]);
            const a     = normalize(custom[i][5]);

            let ok = true;
            if (ikejaQuery && !ikeja.includes(ikejaQuery)) ok = false;
            // Area match: allow either site_area match or node name containing the area code (e.g., "-tmba-")
            const matchesArea = !area || a === area || node.includes(`-${area}`);
            if (!matchesArea) ok = false;
            if (nodes.length && !nodes.includes(node)) ok = false;

            if (ok) {
                count++;
                shownLats.push(trace.lat[i]);
                shownLons.push(trace.lon[i]);
                newOpacity.push(0.9);
            } else {
                newOpacity.push(0.05);
            }
        }

        Plotly.restyle(gd, {"marker.opacity":[newOpacity]}, [idx]);
    });

    document.getElementById("count-label").textContent = "Visible: " + count;
}

document.addEventListener("DOMContentLoaded", () => {
    const gd = getGraph();
    gd.once("plotly_afterplot", () => {
        document.getElementById("apply-btn").onclick = applyFilters;
        applyFilters();
    });
});
</script>
